// Collect all item mappings from both existing and newly created items
const checkResult = $('Check Which Items to Create').first().json;
const itemMapping = { ...checkResult.existingItemMapping };

// Add newly created items to mapping
try {
  const createdItems = $('Create Items').all();
  createdItems.forEach(node => {
    const item = node.json;
    // QuickBooks returns the item in an 'Item' wrapper
    const itemData = item.Item || item;
    if (itemData.Name && itemData.Id) {
      itemMapping[itemData.Name] = itemData.Id;
    }
  });
} catch (error) {
  // No items were created, that's fine
}

// Get the extracted data
const extractedData = $('Prepare Items to Check').first().json.extractedData;

return [{
  json: {
    extractedData: extractedData,
    allItemMapping: itemMapping
  }
}];

const extractedData = $input.first().json.output;
const lineItems = extractedData.line_items || [];

const itemsToCheck = lineItems
  .filter(item => item.item_name && item.item_name.trim() !== '')
  .map(item => ({
    name: item.item_name,
    description: item.description || item.item_name,
    unitPrice: parseFloat(item.unit_price) || parseFloat(item.amount),
    type: 'Service'
  }));

return [{
  json: {
    extractedData: extractedData,
    itemsToCheck: itemsToCheck
  }
}];

