const itemsToCheck = $('Prepare Items to Check').first().json.itemsToCheck;
const existingItems = $input.all();

const existingItemMap = {};
existingItems.forEach(itemNode => {
  const item = itemNode.json;
  if (item.Name) {
    existingItemMap[item.Name.toLowerCase()] = {
      id: item.Id,
      name: item.Name
    };
  }
});

const itemsToCreate = [];
const itemMapping = {};

itemsToCheck.forEach(item => {
  const itemNameLower = item.name.toLowerCase();

  if (existingItemMap[itemNameLower]) {
    itemMapping[item.name] = existingItemMap[itemNameLower].id;
  } else {
    itemsToCreate.push({
      name: item.name,
      description: item.description,
      type: item.type,
      incomeAccountRef: "79",
      expenseAccountRef: "80"
    });
  }
});

return [{
  json: {
    itemsToCreate: itemsToCreate,
    existingItemMapping: itemMapping,
    needsCreation: itemsToCreate.length > 0
  }
}];

const extractedData = $('Collect All Item Mappings').first().json.extractedData;
const itemMapping = $('Collect All Item Mappings').first().json.allItemMapping;

// Get vendor info
let vendorId, vendorName;

try {
  const vendorNode = $('Create Vendor').first();
  vendorId = vendorNode.json.Id;
  vendorName = vendorNode.json.DisplayName;
} catch {
  const vendorNode = $('Find Vendor').first();
  vendorId = vendorNode.json.Id;
  vendorName = vendorNode.json.DisplayName;
}

if (!vendorId) {
  throw new Error(`Vendor not found: ${extractedData.vendor.name}`);
}

// Build line items
const lineItems = [];

extractedData.line_items.forEach((item, index) => {
  // Try exact match first, then case-insensitive match
  let itemId = itemMapping[item.item_name];

  if (!itemId) {
    // Try case-insensitive lookup
    const itemNameLower = item.item_name.toLowerCase();
    for (const [key, value] of Object.entries(itemMapping)) {
      if (key.toLowerCase() === itemNameLower) {
        itemId = value;
        break;
      }
    }
  }

  if (!itemId) {
    throw new Error(`Item not found: ${item.item_name}`);
  }

  const quantity = parseFloat(item.quantity) || 1;
  const unitPrice = parseFloat(item.unit_price) || (parseFloat(item.amount) / quantity);

  lineItems.push({
    LineNum: index + 1,
    Description: item.description || item.item_name,
    Amount: parseFloat(item.amount),
    DetailType: "ItemBasedExpenseLineDetail",
    ItemBasedExpenseLineDetail: {
      ItemRef: {
        value: itemId,
        name: item.item_name
      },
      Qty: quantity,
      UnitPrice: unitPrice,
      BillableStatus: "NotBillable",
      TaxCodeRef: {
        value: "NON"
      }
    }
  });
});

// Add tax if exists
if (extractedData.tax && parseFloat(extractedData.tax) > 0) {
  lineItems.push({
    LineNum: lineItems.length + 1,
    Description: 'Tax',
    Amount: parseFloat(extractedData.tax),
    DetailType: 'AccountBasedExpenseLineDetail',
    AccountBasedExpenseLineDetail: {
      AccountRef: {
        value: '1'
      },
      BillableStatus: 'NotBillable',
      TaxCodeRef: {
        value: 'NON'
      }
    }
  });
}

// Parse dates
let billDate = extractedData.invoice_date;
let dueDate = extractedData.due_date;

if (billDate && !billDate.match(/^\d{4}-\d{2}-\d{2}$/)) {
  billDate = new Date(billDate).toISOString().split('T')[0];
}

if (dueDate && !dueDate.match(/^\d{4}-\d{2}-\d{2}$/)) {
  dueDate = new Date(dueDate).toISOString().split('T')[0];
}

// Build bill payload
const billPayload = {
  Line: lineItems,
  VendorRef: {
    value: vendorId,
    name: vendorName
  },
  DocNumber: extractedData.invoice_number,
  TxnDate: billDate,
  DueDate: dueDate || billDate
};

if (extractedData.vendor?.address) {
  const addressLines = extractedData.vendor.address.split('\n');
  billPayload.VendorAddr = {
    Line1: addressLines[0] || '',
    Line2: addressLines[1] || '',
    Line3: addressLines[2] || ''
  };
}

return {
  json: {
    billPayload: billPayload,
    summary: {
      vendor: vendorName,
      billNumber: extractedData.invoice_number,
      total: extractedData.total,
      lineItems: lineItems.length
    }
  }
};
